import React, {useEffect} from 'react';
import './App.scss';
import {Post} from "./Post";

function App() {
    const [posts, setPost] = useState([
        {
            userName: 'alex_alex-androv',
            caption: 'Wooow!! heey cozy maaan!',
        },
        {
            userName: 'alex_drow',
            caption: 'Wooow!! heey damn maaan!',
        }
    ])


    useEffect(() => {

    }, [])

    return (
        <div className="app">
            <header className='app__header'>
                <img
                    className='app__header-image'
                    src="https://logos-world.net/wp-content/uploads/2020/04/Instagram-Logo.png"
                    alt="logo"/>
            </header>
            {
                posts.map(el => (
                    <>
                        <Post
                            userName={el.userName}
                            caption={el.caption}
                        />
                    </>
                ))
            }
        </div>
    );
}

export default App;
